import styled from "styled-components";

type ButtonType = {
	btnTitle: string;
	link?: string;
};

export function Button({btnTitle, link}: ButtonType) {
	return <StyledButton><a href={link}>{btnTitle}</a></StyledButton>;
}

const StyledButton = styled.button`
width: 60px;
height: 40px;
	border: 2px solid orange;
	background-color: transparent;
`;
